**Describe the bug**
It appears there is a bug causing a consistent native memory leak when calling `Run` using the TensorRT execution provider.

**Urgency**
High. This is blocking any production use of OnnxRuntime for us. We need TensorRT to be able to run our models real-time and the memory leak is quickly causing us to run into memory issues.

**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Windows 10 64-bit
- ONNX Runtime installed from (source or binary): Source since we needed TensorRT support
- ONNX Runtime version: 1.1.0
- Visual Studio version (if applicable): 2019
- GCC/Compiler version (if compiling from source): MSVC 2019
- CUDA/cuDNN version: 10.1, 7
- GPU model and memory: 2060 Super, 8GB

**To Reproduce**
 * Run the following `BenchmarkDotNet` code using OnnxRuntime built with TensorRT support:
```csharp
using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using BenchmarkDotNet.Attributes;
using BenchmarkDotNet.Diagnostics.Windows.Configs;
using Microsoft.ML.OnnxRuntime;
using Microsoft.ML.OnnxRuntime.Tensors;

namespace OnnxRuntimeBenchmark
{
    [NativeMemoryProfiler]
    [MemoryDiagnoser]
    public class Bench
    {
        readonly InferenceSession _session;
        readonly Dictionary<string, NamedOnnxValue> _inputNameToNamedOnnxValue;

        public Bench()
        {
            var modelData = Helper.GetBytes(() => new FileStream("model.onnx",
                FileMode.Open, FileAccess.Read));
            var options = new SessionOptions();
            options.GraphOptimizationLevel = GraphOptimizationLevel.ORT_ENABLE_ALL;
            options.AppendExecutionProvider_Tensorrt(0);
            _session = new InferenceSession(modelData, options);

            var inputMetadata = _session.InputMetadata;
            var outputMetadata = _session.OutputMetadata;

            var inputNameToTensor = inputMetadata.ToDictionary(p => p.Key, p =>
            {
                // There are 3 leading dims, [-1,1,1]
                var dimensions = p.Value.Dimensions;
                dimensions[0] = 1; // Batch-size 1
                var tensor = new DenseTensor<float>(dimensions);
                var buffer = tensor.Buffer;
                return tensor;
            });

            _inputNameToNamedOnnxValue = inputNameToTensor.ToDictionary(p => p.Key,
                p => NamedOnnxValue.CreateFromTensor(p.Key, p.Value));
        }

        [Benchmark]
        public float Run()
        {
            using (var outputs = _session.Run(_inputNameToNamedOnnxValue.Values))
            {
                // Should be IReadOnlyList to allow indexing
                var output = outputs.Single();
                var outputTensor = output.AsTensor<float>();
                Span<int> index = stackalloc int[outputTensor.Rank];
                return outputTensor[index];
            }
        }
    }
}
